import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Система управления производством</h1>
          <p>Скоро здесь будет полноценное приложение</p>
        </header>
      </div>
    </Router>
  );
}

export default App;
